// SPDX-License-Identifier: MIT

pragma solidity 0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";

library MintControl {
    
    function canMint(IERC721Enumerable callingContract, uint256 tokenId) public view returns (bool) {

        if (tokenId > 10) {
            return true;
        }
        else if (tokenId <= 10 && tokenId > 1) {
            return callingContract.totalSupply() >= 5000;
        } else if (tokenId == 1) {
            return exists(callingContract, 2) &&
                exists(callingContract, 3) &&
                exists(callingContract, 4) &&
                exists(callingContract, 5) &&
                exists(callingContract, 6) &&
                exists(callingContract, 7) &&
                exists(callingContract, 8) &&
                exists(callingContract, 9) &&
                exists(callingContract, 10);
        } else {
            return exists(callingContract, 1);
        }
    }

    function exists(IERC721 callingContract, uint256 tokenId) internal view returns (bool) {
        return callingContract.ownerOf(tokenId) == address(0);
    }
}
